import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import api from '../api/api';
import ProjectCard from '../components/ProjectCard';

function Navbar({ username }) {
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem('username');
    navigate('/login');
  };

  return (
    <div className="bg-white shadow-md py-4 px-6 mb-6">
      <div className="max-w-2xl mx-auto flex justify-between items-center">
        <div className="text-blue-700 font-bold text-xl">P-LIB</div>
        <div className="flex items-center gap-4">
          <div className="text-gray-700 text-sm">Hello, {username}</div>
          <button 
            onClick={handleLogout}
            className="text-red-600 text-sm hover:text-red-800"
          >
            Logout
          </button>
        </div>
      </div>
    </div>
  );
}

function HomePage() {
  const [projects, setProjects] = useState([]);
  const username = localStorage.getItem('username');

  useEffect(() => {
    api.get('/projects')
      .then(response => {
        setProjects(response.data);
      })
      .catch(error => {
        console.error('Failed to fetch projects:', error);
      });
  }, []);

  return (
    <div className="bg-gray-100 min-h-screen">
      <Navbar username={username} />

      <div className="p-6">
        <div className="max-w-2xl mx-auto">
          {projects.length > 0 ? (
            projects.map((project, index) => (
              <ProjectCard
                key={index}
                title={project.title}
                date={project.date}
                semester={project.semester}
                description={project.description}
                tags={project.tags}
              />
            ))
          ) : (
            <p>No projects available.</p>
          )}
        </div>
        <div className="max-w-2xl mx-auto flex justify-between mt-4">
          <button className="text-blue-700">Previous</button>
          <button className="text-blue-700">Next</button>
        </div>
      </div>
    </div>
  );
}

export default HomePage;
